INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 100101, 27, "人助けが大好き！　前向き格闘娘", 155, "A", 0, 44, "ヒヨリ", "東山奈央", "トゥインクルウィッシュ", "獣人族", "人助け、応援", 8, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 100201, 5, "戦闘のサポートが得意な、心優しい少女", 158, "O", 0, 47, "ユイ", "種田梨沙", "トゥインクルウィッシュ", "ヒューマン", "料理、人間観察", 4, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 100301, 12, "クールで何事にも真っ直ぐな剣士", 163, "B", 0, 46, "レイ", "早見沙織", "トゥインクルウィッシュ", "魔族", "読書、乗馬、お茶", 1, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 100401, 10, "探検好きのイタズラっ子", 128, "O", 0, 27, "ミソギ", "諸星すみれ", "リトルリリカル", "ヒューマン", "いたずら、探検", 8, 9);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (8, "？？？", 100501, 25, "ヒーローに憧れる騎士見習いの少女", 146, "O", 0, 40, "マツリ", "下田麻美", "王宮騎士団（NIGHTMARE）", "獣人族", "ヒーローごっこ", 11, 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 100601, 22, "甘え上手なみんなの人気者", 150, "O", 0, 42, "アカリ", "浅倉杏美", "悪魔偽王国軍（ディアボロス）", "魔族", "サックス", 11, 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 100701, 23, "プリン大好きゴースト娘", 130, "B", 0, 32, "ミヤコ", "雨宮天", "悪魔偽王国軍（ディアボロス）", "魔族", "プリンを食べること", 1, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 100801, 10, "ボクは誰よりも美しい", 150, "AB", 0, 40, "ユキ", "大空直美", "ヴァイスフリューゲル　ランドソル支部", "エルフ", "鏡で自分を見ること", 10, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 100901, 5, "前世を信じる中二病患者、「疾風の冥姫」", 159, "A", 0, 45, "アンナ", "髙野麻美", "トワイライトキャラバン", "魔族", "小説執筆", 7, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 101001, 22, "マホマホ王国のプリンセス", 155, "O", 0, 42, "マホ", "内田真礼", "自警団（カォン）", "獣人族", "空想、ぬいぐるみ集め", 9, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 101101, 25, "人懐っこくてマシンガントークな妹系少女", 156, "A", 0, 44, "リノ", "阿澄佳奈", "ラビリンス", "ヒューマン", "お裁縫", 8, 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 101201, 24, "みんなのために超能力を使う眠り姫", 156, "A", 0, 46, "ハツネ", "大橋彩香", "フォレスティエ", "エルフ", "妹と遊ぶこと、二度寝、昼寝、早寝", 12, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "", 101301, 21, "オタク全開な魔法少女", 166, "O", 0, 55, "ナナカ", "佳村はるか", "トワイライトキャラバン", "魔族", "読書、魔法", 8, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "test", 101401, 3, "頭脳明晰な美少女名探偵", 152, "AB", 0, 41, "カスミ", "水瀬いのり", "自警団（カォン）", "獣人族", "読書、推理", 11, 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (6, "test", 101501, 5, "母性溢れる優しいみんなの「ミサト先生」", 165, "O", 0, 54, "ミサト", "國府田マリ子", "フォレスティエ", "エルフ", "絵本作り", 9, 21);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 101601, 10, "天真爛漫で人気者のカリスマモデル", 167, "O", 0, 48, "スズナ", "上坂すみれ", "ルーセント学院", "魔族", "ファッション", 4, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 101701, 7, "いつでも「なんくるないさ～」な天然娘", 158, "A", 0, 53, "カオリ", "高森奈津美", "自警団（カォン）", "獣人族", "踊り、空手", 7, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 101801, 14, "多くの男性を魅了する無垢な女教師", 162, "B", 0, 52, "イオ", "伊藤静", "ルーセント学院", "魔族", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 23);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 102001, 3, "お歌もにんじんも、ウサギさんも大好き♪", 117, "O", 0, 21, "ミミ", "日高里菜", "リトルリリカル", "獣人族", "かわいいもの集め", 4, 10);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 102101, 9, "泣き虫で臆病な守ってあげたい女の子", 150, "B", 0, 40, "クルミ", "植田佳奈", "サレンディア救護院", "ヒューマン", "観劇、おままごと", 6, 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 102201, 22, "人見知りであまのじゃくな女の子", 150, "O", 0, 40, "ヨリ", "原紗友里", "悪魔偽王国軍（ディアボロス）", "魔族", "ゲーム全般", 11, 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 102301, 10, "ぷうきちといつも一緒！", 148, "B", 0, 38, "アヤネ", "芹澤優", "サレンディア救護院", "ヒューマン", "屋内でできる遊び", 5, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 102501, 12, "お嬢さまのためにがんばるドジっ娘メイド", 154, "O", 0, 43, "スズメ", "悠木碧", "サレンディア救護院", "ヒューマン", "ご奉仕", 12, 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "test", 102601, 1, "遊びと睡眠が何より大事なぐうたら娘", 144, "B", 0, 42, "リン", "小岩井ことり", "牧場（エリザベスパーク）", "獣人族", "あんパン", 1, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 102701, 30, "運命の相手に一途すぎる乙女", 154, "B", 0, 43, "エリコ", "橋本ちなみ", "トワイライトキャラバン", "魔族", "実験、裁縫、料理", 7, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 102801, 4, "救護院を経営する優しい庶民派お嬢様", 156, "A", 0, 43, "サレン", "堀江由衣", "サレンディア救護院", "エルフ", "経営、お茶会", 10, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 102901, 24, "歌って踊れる大人気アイドル", 157, "B", 0, 40, "ノゾミ", "日笠陽子", "カルミナ", "ヒューマン", "舞台鑑賞、ダンス", 1, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 103001, 31, "トーゴクの神秘、オシエテクダサイ！", 163, "O", 0, 51, "ニノン", "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "忍法開発", 8, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 103101, 22, "占いが得意な霊能少女", 157, "AB", 0, 42, "シノブ", "大坪由佳", "悪魔偽王国軍（ディアボロス）", "魔族", "占い", 12, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 103201, 12, "一人前の商人を目指すパワフルお嬢様", 157, "AB", 0, 45, "アキノ", "松嵜麗", "メルクリウス財団", "ヒューマン", "慈善事業", 3, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 103301, 3, "みんなを笑顔にするお笑い牧場主", 142, "B", 0, 35, "マヒル", "新田恵海", "牧場（エリザベスパーク）", "ヒューマン", "漫才", 3, 20);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 103401, 16, "純情でほっとけない大人の女性", 164, "A", 0, 55, "ユカリ", "今井麻美", "メルクリウス財団", "エルフ", "ウインドーショッピング", 3, 22);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (5, "test", 103601, 2, "礼儀正しくしっかり者のちびっ子優等生", 118, "A", 0, 21, "キョウカ", "小倉唯", "リトルリリカル", "エルフ", "お勉強", 2, 8);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (8, "test", 103701, 11, "義理堅くてからかい好きな剣術少女", 149, "A", 0, 43, "トモ", "茅原実里", "王宮騎士団（NIGHTMARE）", "ヒューマン", "剣術、年長者をからかう", 8, 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 103801, 3, "読書が趣味の病弱少女", 153, "A", 0, 40, "シオリ", "小清水亜美", "牧場（エリザベスパーク）", "獣人族", "読書、お散歩", 11, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 104001, 6, "「友達」に憧れる、エルフの森の女の子", 158, "AB", 0, 44, "アオイ", "花澤香菜", "フォレスティエ", "エルフ", "友達作りのイメトレ", 6, 13);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 104201, 3, "人々を守るために歌う、唱喚士の少女", 163, "O", 0, 46, "チカ", "福原綾香", "カルミナ", "ヒューマン", "各種楽器", 6, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 104301, 9, "男勝りで情に厚いワイルド娘", 168, "O", 0, 54, "マコト", "小松未可子", "自警団（カォン）", "獣人族", "お菓子作り", 8, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "test", 104401, 5, "かつては夜を支配した最強の吸血鬼", 172, "A", 0, 50, "イリヤ", "丹下桜", "悪魔偽王国軍（ディアボロス）", "魔族", "世界征服", 5, "??");
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 104501, 19, "妄想大好き！　ほんとは照れ屋な女の子", 157, "AB", 0, 49, "クウカ", "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "小説を読むこと", 11, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 104601, 1, "弱きを助け強きをくじく猫娘", 158, "AB", 0, 48, "タマキ", "沼倉愛美", "メルクリウス財団", "獣人族", "猫とたわむれること", 3, 19);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (8, "？？？", 104701, 25, "素顔を見せない冷静沈着な女性騎士", 171, "A", 0, 50, "ジュン", "川澄綾子", "王宮騎士団（NIGHTMARE）", "ヒューマン", "格闘技、湯浴み", 10, 25);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 104801, 11, "仕事も私事も効率優先な傭兵少女", 163, "O", 0, 49, "ミフユ", "田所あずさ", "メルクリウス財団", "ヒューマン", "傭兵などのアルバイト", 11, 20);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 104901, 24, "お姉ちゃんがお世話してあげるからねっ！", 168, "O", 0, 54, "シズル", "生天目仁美", "ラビリンス", "ヒューマン", "家事全般", 10, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 105001, 3, "ちょっとおませな恋に恋する女の子", 120, "A", 0, 22, "ミサキ", "久野美咲", "ルーセント学院", "魔族", "ファッション誌鑑賞、コスメ集め", 1, 11);
