INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 107701, 12, "お嬢さまのためにがんばるドジっ娘メイド", 154, "O", 0, 43, "スズメ（サマー）", "悠木碧", "サレンディア救護院", "ヒューマン", "ご奉仕", 12, 15);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (1, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 107801, 2, "行き倒れの謎のネコミミ魔法使い", 152, "A", 0, 39, "キャル（サマー）", "立花理香", "美食殿", "獣人族", "猫と遊ぶ", 9, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 107901, 1, "弱きを助け強きをくじく猫娘", 158, "AB", 0, 48, "タマキ（サマー）", "沼倉愛美", "メルクリウス財団", "獣人族", "猫とたわむれること", 3, 19);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 108001, 11, "仕事も私事も効率優先な傭兵少女", 163, "O", 0, 49, "ミフユ（サマー）", "田所あずさ", "メルクリウス財団", "ヒューマン", "傭兵などのアルバイト", 11, 20);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 108101, 22, "占いが得意な霊能少女", 157, "AB", 0, 42, "シノブ（ハロウィン）", "大坪由佳", "悪魔偽王国軍（ディアボロス）", "魔族", "占い", 12, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 108201, 23, "プリン大好きゴースト娘", 130, "B", 0, 32, "ミヤコ（ハロウィン）", "雨宮天", "悪魔偽王国軍（ディアボロス）", "魔族", "プリンを食べること", 1, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 108301, 3, "ちょっとおませな恋に恋する女の子", 120, "A", 0, 22, "ミサキ（ハロウィン）", "久野美咲", "ルーセント学院", "魔族", "ファッション誌鑑賞、コスメ集め", 1, 11);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 108401, 3, "人々を守るために歌う、唱喚士の少女", 163, "O", 0, 46, "チカ（クリスマス）", "福原綾香", "カルミナ", "ヒューマン", "各種楽器", 6, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 108501, 9, "泣き虫で臆病な守ってあげたい女の子", 150, "B", 0, 40, "クルミ（クリスマス）", "植田佳奈", "サレンディア救護院", "ヒューマン", "観劇、おままごと", 6, 12);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 108601, 10, "ぷうきちといつも一緒！", 148, "B", 0, 38, "アヤネ（クリスマス）", "芹澤優", "サレンディア救護院", "ヒューマン", "屋内でできる遊び", 5, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 108701, 27, "人助けが大好き！　前向き格闘娘", 155, "A", 0, 44, "ヒヨリ（ニューイヤー）", "東山奈央", "トゥインクルウィッシュ", "獣人族", "人助け、応援", 8, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 108801, 5, "戦闘のサポートが得意な、心優しい少女", 158, "O", 0, 47, "ユイ（ニューイヤー）", "種田梨沙", "トゥインクルウィッシュ", "ヒューマン", "料理、人間観察", 4, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 108901, 12, "クールで何事にも真っ直ぐな剣士", 163, "B", 0, 46, "レイ（ニューイヤー）", "早見沙織", "トゥインクルウィッシュ", "魔族", "読書、乗馬、お茶", 1, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 109001, 30, "運命の相手に一途すぎる乙女", 154, "B", 0, 43, "エリコ（バレンタイン）", "橋本ちなみ", "トワイライトキャラバン", "魔族", "実験、裁縫、料理", 7, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 109101, 24, "お姉ちゃんがお世話してあげるからねっ！", 168, "O", 0, 54, "シズル（バレンタイン）", "生天目仁美", "ラビリンス", "ヒューマン", "家事全般", 10, 18);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES ("", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 109201, 1, "英霊と契約を結んだマナリアの天才王女", 156, "AB", 0, 55, "アン", "日笠陽子", "？？？", "ヒューマン", "読書", 12, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES ("", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 109301, 4, "マナリア魔法学院の新入生", 144, "O", 0, 45, "ルゥ", "こやまきみこ", "？？？", "ヒューマン", "食べること、眠ること", 2, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES ("", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 109401, 3, "人を超越した力を有す心優しい竜姫", 167, "B", 0, 67, "グレア", "福原綾香", "？？？", "半人半竜", "ピアノ", 11, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 109501, 19, "妄想大好き！　ほんとは照れ屋な女の子", 157, "AB", 0, 49, "クウカ（オーエド）", "長妻樹里", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "小説を読むこと", 11, 18);
