INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 116001, 22, "マホマホ王国のプリンセス", 155, "O", 0, 42, "マホ（シンデレラ）", "内田真礼", "自警団（カォン）", "獣人族", "空想、ぬいぐるみ集め", 9, 16);
