INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 116801, 1, "弱きを助け強きをくじく猫娘", 158, "AB", 0, 48, "タマキ（作業服）", "沼倉愛美", "メルクリウス財団", "獣人族", "猫とたわむれること", 3, 19);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 116901, 11, "仕事も私事も効率優先な傭兵少女", 163, "O", 0, 49, "ミフユ（作業服）", "田所あずさ", "メルクリウス財団", "ヒューマン", "傭兵などのアルバイト", 11, 20);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 117001, 30, "運命の相手に一途すぎる乙女", 154, "B", 0, 43, "エリコ（サマー）", "橋本ちなみ", "トワイライトキャラバン", "魔族", "実験、裁縫、料理", 7, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 117101, 24, "お姉ちゃんがお世話してあげるからねっ！", 168, "O", 0, 54, "シズル（サマー）", "生天目仁美", "ラビリンス", "ヒューマン", "家事全般", 10, 18);
