INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 117301, 3, "人々を守るために歌う、唱喚士の少女", 163, "O", 0, 46, "チカ（サマー）", "福原綾香", "カルミナ", "ヒューマン", "各種楽器", 6, 17);
