INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 117501, 7, "実験が趣味の危険な科学者", 166, "A", 0, 53, "ミツキ（オーエド）", "三石琴乃", "トワイライトキャラバン", "ヒューマン", "研究、実験", 3, 27);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 117601, 10, "ボクは誰よりも美しい", 150, "AB", 0, 40, "ユキ（オーエド）", "大空直美", "ヴァイスフリューゲル　ランドソル支部", "エルフ", "鏡で自分を見ること", 10, 14);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 117701, 7, "いつでも「なんくるないさ～」な天然娘", 158, "A", 0, 53, "カオリ（ハロウィン）", "高森奈津美", "自警団（カォン）", "獣人族", "踊り、空手", 7, 17);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 117801, 31, "トーゴクの神秘、オシエテクダサイ！", 163, "O", 0, 51, "ニノン（ハロウィン）", "佐藤聡美", "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "忍法開発", 8, 16);
INSERT INTO `v1_fef0f496d837740b499e695b77444e7732c99e6208b4637d7b2ed653ad57b4eb` VALUES (14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 117901, 10, "天真爛漫で人気者のカリスマモデル", 167, "O", 0, 48, "スズナ（ハロウィン）", "上坂すみれ", "ルーセント学院", "魔族", "ファッション", 4, 17);
